/* ===============================
   Ë°®Ê†ºÊéíÁâàÂ∑•ÂÖ∑ÔºàÁ≠âÂØ¨ code blockÔºâ
================================ */
function strWidth(s) {
  // Á≤óÁï•ÔºöASCII=1ÔºåCJK=2ÔºõÁâπ‰æãÔºö‚Äî Ë¶ñÁÇ∫ 1ÔºàDiscord È°ØÁ§∫ÈÄöÂ∏∏ÊòØ 1 Ê†ºÔºâ
  let w = 0;
  for (const ch of String(s)) {
    if (ch === "‚Äî") {
      w += 1;
      continue;
    }
    w += ch.charCodeAt(0) <= 0x7f ? 1 : 2;
  }
  return w;
}

function padRight(s, width) {
  s = String(s);
  const w = strWidth(s);
  if (w >= width) return s;
  return s + " ".repeat(width - w);
}

function padLeft(s, width) {
  s = String(s);
  const w = strWidth(s);
  if (w >= width) return s;
  return " ".repeat(width - w) + s;
}

// ‚úÖ Newline helperÔºàÈÅøÂÖç join("\n") Ë¢´Á∑®ËºØÂô®Êñ∑Ë°åÂºÑÁàÜÔºâ
const NL = String.fromCharCode(10);



/* ===============================
   ÂúñÁâáÁúãÊùøÔºàÊñπÊ°à 3ÔºöÂõ∫ÂÆöËÉåÊôØÊ®°Êùø + Áî¢Âá∫ PNGÔºâ
   - ‰∏çÂãïÂéüÊú¨Ë≥áÊñôÈÇèËºØÔºõËã•Áí∞Â¢ÉÊ≤íË£ùÁπ™ÂúñÂ•ó‰ª∂ÊúÉËá™ÂãïÂõûËêΩÂà∞ÊñáÂ≠óË°®Ê†º
   - ÂïüÁî®ÊñπÂºèÔºöË®≠ÂÆöÁí∞Â¢ÉËÆäÊï∏ IMAGE_BOARD=1
================================ */
// ‰Ω†ÊåáÂÆöÁöÑ FF14 È¢®Ê†ºÂõ∫ÂÆöËÉåÊôØÔºàJPG, 900x1350Ôºâ‚Äî ‰ª• base64 ÂÖßÂµåÔºåÈÅøÂÖçÈ°çÂ§ñÊ™îÊ°àÁÆ°ÁêÜ
const FF14_BG_JPG_B64 = "";

const IMAGE_BOARD_ENABLED = String(process.env.IMAGE_BOARD || "").trim() === "1";

// ÂãïÊÖãËºâÂÖ• @napi-rs/canvasÔºàÊ≤íÂÆâË£ùÂ∞±ÂõûËêΩÊñáÂ≠óÁâàÔºå‰∏çÊúÉËÆì bot ÊéõÊéâÔºâ
let __canvasPromise = null;
async function getCanvasModule() {
  if (__canvasPromise) return __canvasPromise;
  __canvasPromise = (async () => {
    try {
      const mod = await import("@napi-rs/canvas");
      return mod;
    } catch {
      return null;
    }
  })();
  return __canvasPromise;
}

function clamp(n, a, b) {
  return Math.max(a, Math.min(b, n));
}

function drawRoundedRect(ctx, x, y, w, h, r) {
  const rr = Math.min(r, w / 2, h / 2);
  ctx.beginPath();
  ctx.moveTo(x + rr, y);
  ctx.arcTo(x + w, y, x + w, y + h, rr);
  ctx.arcTo(x + w, y + h, x, y + h, rr);
  ctx.arcTo(x, y + h, x, y, rr);
  ctx.arcTo(x, y, x + w, y, rr);
  ctx.closePath();
}

function fmtPctArrow(deltaPct) {
  if (deltaPct === null || deltaPct === undefined) return "‚Äî";
  const d = Number(deltaPct);
  if (!Number.isFinite(d)) return "‚Äî";
  const arrow = d > 0 ? "‚Üë" : d < 0 ? "‚Üì" : "‚Üí";
  const sign = d > 0 ? "+" : "";
  return `${arrow} ${sign}${d.toFixed(0)}%`;
}

async function renderMarketBoardPNG({
  itemName,
  bestNQ,
  bestHQ,
  pricesNQ,
  pricesHQ,
}) {
  const canvasMod = await getCanvasModule();
  if (!canvasMod) return null;

  const { createCanvas, loadImage } = canvasMod;

  const W = 900;
  const H = 1350;
  const canvas = createCanvas(W, H);
  const ctx = canvas.getContext("2d");

  // ËÉåÊôØ
  const bgBuf = Buffer.from(FF14_BG_JPG_B64, "base64");
  const bgImg = await loadImage(bgBuf);
  ctx.drawImage(bgImg, 0, 0, W, H);

  // ÊöóËßí + ‰∏≠Â§ÆÈÅÆÁΩ©ÔºàËÆìÂ≠óÊõ¥Ê∏ÖÊ•öÔºâ
  ctx.fillStyle = "rgba(0,0,0,0.18)";
  ctx.fillRect(0, 0, W, H);

  // ÂÖßÂÆπÈù¢ÊùøÔºàÂçäÈÄèÊòéÔºâ
  const panelX = 70;
  const panelY = 140;
  const panelW = W - 140;
  const panelH = H - 240;

  ctx.save();
  drawRoundedRect(ctx, panelX, panelY, panelW, panelH, 22);
  ctx.fillStyle = "rgba(15, 18, 22, 0.62)";
  ctx.fill();
  ctx.lineWidth = 2;
  ctx.strokeStyle = "rgba(255, 215, 128, 0.35)";
  ctx.stroke();
  ctx.restore();

  // Ê®ôÈ°å
  ctx.fillStyle = "rgba(255,255,255,0.95)";
  ctx.font = "bold 34px sans-serif";
  ctx.fillText("FF14 Market", panelX + 24, panelY + 54);

  ctx.font = "600 24px sans-serif";
  ctx.fillStyle = "rgba(255,255,255,0.9)";
  const safeName = String(itemName || "").slice(0, 40);
  ctx.fillText(`Áâ©ÂìÅÔºö${safeName}`, panelX + 24, panelY + 92);

  // Âø´ÈÄüÈáçÈªû
  ctx.font = "bold 22px sans-serif";
  ctx.fillStyle = "rgba(255,255,255,0.92)";
  ctx.fillText("Âø´ÈÄüÈáçÈªû", panelX + 24, panelY + 132);

  ctx.font = "600 20px sans-serif";
  const yQuick = panelY + 164;
  if (bestNQ) {
    ctx.fillText(
      `NQ ÊúÄ‰ΩéÔºö${bestNQ.world}  ${fmtPrice(bestNQ.price)}Ôºà${fmtPctArrow(bestNQ.deltaPct)}Ôºâ`,
      panelX + 24,
      yQuick
    );
  } else {
    ctx.fillText("NQ ÊúÄ‰ΩéÔºö‚Äî", panelX + 24, yQuick);
  }

  if (bestHQ) {
    ctx.fillText(
      `HQ ÊúÄ‰ΩéÔºö${bestHQ.world}  ${fmtPrice(bestHQ.price)}Ôºà${fmtPctArrow(bestHQ.deltaPct)}Ôºâ`,
      panelX + 24,
      yQuick + 28
    );
  } else {
    ctx.fillText("HQ ÊúÄ‰ΩéÔºö‚Äî", panelX + 24, yQuick + 28);
  }

  // Ë°®Ê†ºÁπ™Ë£ΩÂ∑•ÂÖ∑
  function drawTableSection(title, rows, bestWorld, startY) {
    let y = startY;

    // section title
    ctx.font = "bold 22px sans-serif";
    ctx.fillStyle = "rgba(255,255,255,0.92)";
    ctx.fillText(title, panelX + 24, y);
    y += 20;

    // header row
    ctx.font = "bold 18px sans-serif";
    ctx.fillStyle = "rgba(255,255,255,0.82)";
    const colX = {
      world: panelX + 24,
      price: panelX + 360,
      delta: panelX + 555,
      avg: panelX + 680,
    };
    ctx.fillText("‰º∫ÊúçÂô®", colX.world, y + 22);
    ctx.fillText("ÊúÄ‰Ωé", colX.price, y + 22);
    ctx.fillText("Â∑ÆÁï∞", colX.delta, y + 22);
    ctx.fillText("ÂùáÂÉπ", colX.avg, y + 22);

    // divider
    ctx.strokeStyle = "rgba(255,255,255,0.18)";
    ctx.lineWidth = 1;
    ctx.beginPath();
    ctx.moveTo(panelX + 24, y + 32);
    ctx.lineTo(panelX + panelW - 24, y + 32);
    ctx.stroke();

    y += 44;

    const rowH = 32; // Á∑äÊπäË°åË∑ù
    ctx.font = "600 18px sans-serif";

    for (let i = 0; i < rows.length; i++) {
      const r = rows[i];
      const isBest = bestWorld && r.world === bestWorld;

      // zebra
      if (i % 2 === 0) {
        ctx.fillStyle = "rgba(255,255,255,0.04)";
        ctx.fillRect(panelX + 18, y - 22, panelW - 36, rowH);
      }

      // BEST ÈªÉËâ≤È´ò‰∫Æ
      if (isBest) {
        ctx.fillStyle = "rgba(255, 213, 79, 0.28)";
        ctx.fillRect(panelX + 18, y - 22, panelW - 36, rowH);
        ctx.strokeStyle = "rgba(249, 168, 37, 0.85)";
        ctx.lineWidth = 2;
        ctx.strokeRect(panelX + 18, y - 22, panelW - 36, rowH);
      }

      ctx.fillStyle = "rgba(255,255,255,0.92)";
      const label = `${isBest ? "‚òÖ " : ""}${r.world}`;
      ctx.fillText(String(label).slice(0, 14), colX.world, y);

      const priceTxt = r.price === null ? "‚Äî" : fmtPriceCompact(r.price);
      const avgTxt = r.avgSold === null ? "‚Äî" : fmtPriceCompact(r.avgSold);
      const dTxt = r.deltaPct === null ? "‚Äî" : deltaBadge(r.deltaPct);

      // Âè≥Â∞çÈΩäÔºöÁî® measureText
      function drawRight(text, xRight) {
        const t = String(text);
        const w = ctx.measureText(t).width;
        ctx.fillText(t, xRight - w, y);
      }
      drawRight(priceTxt, colX.price + 110);
      drawRight(dTxt, colX.delta + 90);
      drawRight(avgTxt, colX.avg + 110);

      y += rowH;
    }

    return y + 22;
  }

  // ÂèñÂâçÂπæÂêçÈÅøÂÖçÂ§™Èï∑Ôºà‰Ω†‰πüÂèØ‰ª•ÊîπÊàê WORLD_LIST ÂÖ®ÈÉ®È°ØÁ§∫Ôºâ
  function topRows(prices, limit = 8) {
    const rows = (prices || []).slice();
    // Ê≤íÂÉπÊ†ºÁöÑÊéíÂæåÈù¢
    rows.sort((a, b) => {
      const ap = a.price === null ? Number.POSITIVE_INFINITY : a.price;
      const bp = b.price === null ? Number.POSITIVE_INFINITY : b.price;
      return ap - bp;
    });
    return rows.slice(0, limit);
  }

  let y = panelY + 230;
  if (pricesNQ && pricesNQ.length) {
    y = drawTableSection("NQ Â∏ÇÂ†¥‰∏ÄË¶ΩÔºàÂâç 8 ÂêçÔºâ", topRows(pricesNQ, 8), bestNQ?.world, y);
  }
  if (pricesHQ && pricesHQ.length) {
    y = drawTableSection("HQ Â∏ÇÂ†¥‰∏ÄË¶ΩÔºàÂâç 8 ÂêçÔºâ", topRows(pricesHQ, 8), bestHQ?.world, y);
  }

  // footerÔºàÁõ°ÈáèË≤ºÂ∫ïÔºâ
  ctx.font = "14px sans-serif";
  ctx.fillStyle = "rgba(255,255,255,0.65)";
  ctx.fillText("ÔºäÂúñÁâáÁúãÊùøÊ®°ÂºèÔºöÂ¶ÇÊûúÊú™È°ØÁ§∫ÔºåË´ãÂÆâË£ù @napi-rs/canvas ÊàñÈóúÈñâ IMAGE_BOARD„ÄÇ", panelX + 24, panelY + panelH - 22);

  // Ëº∏Âá∫ PNG
  return canvas.toBuffer("image/png");
}

/* ===============================
   CafeMakerÔºöÊêúÂ∞ã / Áâ©ÂìÅË≥áË®ä
================================ */
async function cafemakerSearch(query, limit = 20) {
  const url = `https://cafemaker.wakingsands.com/search?string=${encodeURIComponent(
    t2s(query)
  )}&indexes=item&limit=${limit}`;

  const res = await fetch(url);
  const data = await res.json();

  const results = (data?.Results || []).map((r) => {
    const nameTW = s2t(r.Name);
    return {
      id: Number(r.ID),
      name: nameTW,
      score: similarity(query, nameTW),
    };
  });

  results.sort((a, b) => b.score - a.score);
  return results;
}

async function cafemakerGetItemMeta(id) {
  const url = `https://cafemaker.wakingsands.com/item/${id}?language=chs&columns=ID,Name,ItemSearchCategory.Name,ItemUICategory.Name`;
  const res = await fetch(url);
  if (!res.ok) throw new Error(`HTTP ${res.status}`);
  const d = await res.json();

  const nameTW = s2t(d?.Name || "");
  const isc = s2t(d?.ItemSearchCategory?.Name || "");
  const iuc = s2t(d?.ItemUICategory?.Name || "");

  return {
    id: Number(d?.ID || id),
    name: nameTW || String(id),
    itemSearchCategory: isc || "",
    itemUiCategory: iuc || "",
  };
}

/* ===============================
   ÊïëÊè¥ÊêúÂ∞ãÔºàcafemakerÔºâ
   „ÄêÂîØ‰∏ÄÊîπÂãï„ÄëÂä†ÂÖ• SAFE_SUFFIXES ÁôΩÂêçÂñÆÂæåÁ∂¥ÊïëÊè¥Ôºà‰∏çÂΩ±ÈüøÂ≠∏ÁøíÔºâ
================================ */
async function rescueSearch(originalQuery, mappedQuery) {
  const attempts = [];
  const seen = new Set();

  const pushAttempt = (q, reason) => {
    const qq = (q || "").trim();
    if (!qq) return;
    if ([...qq].length < 2) return;
    if (seen.has(qq)) return;
    seen.add(qq);
    attempts.push({ q: qq, reason });
  };

  if (mappedQuery && mappedQuery !== originalQuery) pushAttempt(mappedQuery, "Ë©ûÂΩôÊò†Â∞Ñ");

  const suffixes = ["Ë£ùÂÇôÁÆ±", "ÁÆ±Â≠ê", "ÂØ∂ÁÆ±", "Â•óË£ù", "Â§ñÂ•ó", "ÊâãÂ•ó", "Èù¥", "Èûã", "Â∏Ω", "È†≠Áõî"];
  for (const suf of suffixes) {
    if (originalQuery.endsWith(suf) && originalQuery.length > suf.length + 1) {
      pushAttempt(originalQuery.slice(0, -suf.length), `ÂéªÊéâÂæåÁ∂¥„Äå${suf}„Äç`);
    }
    if (mappedQuery.endsWith(suf) && mappedQuery.length > suf.length + 1) {
      pushAttempt(mappedQuery.slice(0, -suf.length), `ÂéªÊéâÂæåÁ∂¥„Äå${suf}„Äç(Êò†Â∞ÑÂæå)`);
    }
  }

  if (originalQuery.length >= 4) pushAttempt(originalQuery.slice(0, 3), "ÂèñÂâç 3 Â≠ó");
  if (originalQuery.length >= 3) pushAttempt(originalQuery.slice(0, 2), "ÂèñÂâç 2 Â≠ó");
  if (mappedQuery.length >= 4) pushAttempt(mappedQuery.slice(0, 3), "ÂèñÂâç 3 Â≠ó(Êò†Â∞ÑÂæå)");
  if (mappedQuery.length >= 3) pushAttempt(mappedQuery.slice(0, 2), "ÂèñÂâç 2 Â≠ó(Êò†Â∞ÑÂæå)");

  // === ÂÆâÂÖ®ÁâàÁôΩÂêçÂñÆÂæåÁ∂¥ÊïëÊè¥ÔºàÊñ∞Â¢ûÔºå‰∏çÂΩ±Èüø term_map / manualÔºâ===
  const SAFE_SUFFIXES = ["ÁµêÊô∂Áâá", "ËóèÂØ∂Âúñ", "È≠îÁ¥ã"];
  for (const suf of SAFE_SUFFIXES) {
    if (originalQuery.endsWith(suf)) {
      pushAttempt(suf, `ÂèñÂæåÁ∂¥„Äå${suf}„Äç`);
    }
    if (mappedQuery.endsWith(suf)) {
      pushAttempt(suf, `ÂèñÂæåÁ∂¥„Äå${suf}„Äç(Êò†Â∞ÑÂæå)`);
    }
  }

  for (const a of attempts) {
    try {
      const results = await cafemakerSearch(a.q, 20);
      if (results.length) return { results, usedQuery: a.q, reason: a.reason };
    } catch {
      // ignore
    }
  }
  return { results: [], usedQuery: null, reason: null };
}

/* ===============================
   Â§ßÂàÜÈ°ûÁÄèË¶ΩÔºöË¶èÂâá / Session
================================ */
const CATEGORY_SEEDS = {
  Âú∞Âúñ: ["ËóèÂØ∂Âúñ", "Èô≥ËàäÁöÑËóèÂØ∂Âúñ", "È≠îÁ¥ã", "ÈæçÁöÆ", "Âú∞Âúñ"],
  Á§¶Áü≥: ["Á§¶", "ÂéüÁ§¶", "Á§¶Áü≥", "Á§¶Á†Ç", "Á¢éÊô∂"],
  Êú®Êùê: ["ÂéüÊú®", "Êú®Êùê", "Êú®", "Êú®Êùø"],
  ÁöÆÈù©: ["ÁöÆÈù©", "Áç∏ÁöÆ", "Èù©"],
  Â∏ÉÊñô: ["Â∏É", "Â∏ÉÊñô", "Áµ≤", "ÊØõÁ∑ö"],
  È£üÊùê: ["È£üÊùê", "ËÇâ", "È≠ö", "Ëî¨Ëèú", "È¶ôÊñô"],
};

function normalizeCategoryInput(raw) {
  let s = (raw || "").trim();
  if (!s) return null;
  const m = s.match(/^\((.+)\)$/);
  if (m && m[1]) s = m[1].trim();
  if (s.startsWith(CATEGORY_TRIGGER_PREFIX)) {
    s = s.slice(CATEGORY_TRIGGER_PREFIX.length).trim();
  }
  return s || null;
}

function isCategoryBrowse(raw) {
  const s = (raw || "").trim();
  if (!s) return false;
  if (s.startsWith(CATEGORY_TRIGGER_PREFIX)) return true;
  if (/^\(.+\)$/.test(s)) return true;
  return Object.prototype.hasOwnProperty.call(CATEGORY_SEEDS, s);
}

function mapSubCategoryName(itemName) {
  const name = String(itemName || "");
  const g = name.match(/G\s*(\d+)/i) || name.match(/Ôºß\s*(\d+)/);
  if (g && g[1]) return `G${g[1]}`;
  if (name.includes("È≠îÁ¥ã")) return "È≠îÁ¥ã";
  if (name.includes("ÈæçÁöÆ")) return "ÈæçÁöÆ";
  if (name.includes("Èô≥Ëàä")) return "Èô≥Ëàä";
  if (name.includes("ËóèÂØ∂Âúñ")) return "ÂÖ∂‰ªñËóèÂØ∂Âúñ";
  return "ÂÖ∂‰ªñ";
}

function makeSessionId() {
  return Math.random().toString(36).slice(2, 10);
}

const UI_SESSIONS = new Map();
function putSession(sid, obj) {
  UI_SESSIONS.set(sid, { ...obj, updatedAt: Date.now() });
  if (UI_SESSIONS.size > 200) {
    const entries = [...UI_SESSIONS.entries()].sort((a, b) => (a[1].updatedAt || 0) - (b[1].updatedAt || 0));
    for (let i = 0; i < 50; i++) UI_SESSIONS.delete(entries[i][0]);
  }
}
function getSession(sid) {
  const s = UI_SESSIONS.get(sid);
  if (!s) return null;
  s.updatedAt = Date.now();
  return s;
}
function delSession(sid) {
  UI_SESSIONS.delete(sid);
}

function slicePage(arr, page, pageSize) {
  const p = Math.max(0, Number(page || 0));
  const start = p * pageSize;
  return { page: p, start, end: start + pageSize, total: arr.length, items: arr.slice(start, start + pageSize) };
}

function buildPickRowsFromList(list, sessionId, prefix, page, pageSize) {
  const { page: p, items, total } = slicePage(list, page, pageSize);

  const rows = [];
  for (let i = 0; i < items.length; i += 5) {
    const row = new ActionRowBuilder();
    items.slice(i, i + 5).forEach((it, idx) => {
      const label = `${i + idx + 1 + p * pageSize}. ${it.label}`;
      const idPart = it.key;
      row.addComponents(
        new ButtonBuilder()
          .setCustomId(`${prefix}_${sessionId}_${idPart}`)
          .setLabel(label.slice(0, 80))
          .setStyle(ButtonStyle.Primary)
      );
    });
    rows.push(row);
  }

  const maxPage = Math.max(0, Math.ceil(total / pageSize) - 1);
  const nav = new ActionRowBuilder()
    .addComponents(
      new ButtonBuilder()
        .setCustomId(`nav_${sessionId}_prev`)
        .setLabel("‚¨ÖÔ∏è ‰∏ä‰∏ÄÈ†Å")
        .setStyle(ButtonStyle.Secondary)
        .setDisabled(p <= 0),
      new ButtonBuilder()
        .setCustomId(`nav_${sessionId}_next`)
        .setLabel("‰∏ã‰∏ÄÈ†Å ‚û°Ô∏è")
        .setStyle(ButtonStyle.Secondary)
        .setDisabled(p >= maxPage),
    );

  rows.push(nav);
  return { rows, page: p, maxPage };
}

async function buildBrowseCategories(keyword) {
  const key = String(keyword || "").trim();
  if (!key) return { cats: [], items: [] };

  const seeds = CATEGORY_SEEDS[key] || [key];
  const candidates = [];
  const seen = new Set();

  for (const seed of seeds) {
    try {
      const rs = await cafemakerSearch(seed, CATEGORY_SEARCH_LIMIT);
      for (const r of rs) {
        if (!r?.id) continue;
        if (seen.has(r.id)) continue;
        seen.add(r.id);
        candidates.push({ id: r.id, name: r.name });
      }
    } catch {}
  }

  if (!candidates.length) return { cats: [], items: [] };

  const limit = pLimit(CATEGORY_META_CONCURRENCY);
  const metas = [];
  await Promise.allSettled(
    candidates.map((c) =>
      limit(async () => {
        try {
          const m = await cafemakerGetItemMeta(c.id);
          if (m?.id) metas.push(m);
        } catch {}
      })
    )
  );

  const group = new Map();
  for (const m of metas) {
    let label = "";
    let catKey = "";
    if (key === "Âú∞Âúñ") {
      label = mapSubCategoryName(m.name);
      catKey = label;
    } else {
      label = m.itemSearchCategory || m.itemUiCategory || "ÂÖ∂‰ªñ";
      catKey = label;
    }
    if (!group.has(catKey)) group.set(catKey, { label, items: [] });
    group.get(catKey).items.push({ id: m.id, name: m.name });
  }

  const cats = [...group.entries()]
    .map(([k, v]) => ({
      key: k,
      label: `${v.label}Ôºà${v.items.length}Ôºâ`,
      rawLabel: v.label,
      items: v.items.sort((a, b) => a.name.localeCompare(b.name, "zh-Hant")),
    }))
    .sort((a, b) => b.items.length - a.items.length);

  return { cats, items: metas };
}

